import React, { Component } from 'react';
import { Container} from 'react-bootstrap';

class listarUsuarios extends Component {
    render() {
        return (
            <Container>
                <Row>
                    <h1>Usuarios</h1>
                </Row>
                <Row>
                    <Table striped bordered hover size="sm">
                        <thead>
                            <tr>
                                <th>
                                    Login
                                </th>
                                <th>
                                    Senha
                                </th>
                                <th>
                                    Ações
                                </th>
                            </tr>
                        </thead>
                    </Table>
                </Row>
            </Container>
        );
    }
}

export default listarUsuarios;
